import React from 'react';
import {Link} from 'react-router-dom';

function Navbar() {
  const style = {
    backgroundColor: '#000',
    color: '#fff',
    padding: '10px 20px',
    display: 'flex',
    gap: '20px',
    fontFamily: '"Times New Roman", serif',
    fontWeight: 'bold',
    position: 'sticky',
    top: 0,
    zIndex: 1000
  };

  const linkStyle = {
    color: '#d4af37', // gold color
    textDecoration: 'none'
  };

  return React.createElement('nav', {style: style},
    React.createElement(Link, {to: '/', style: linkStyle}, 'Home'),
    React.createElement(Link, {to: '/new-product', style: linkStyle}, 'New Product'),
    React.createElement(Link, {to: '/qr-generate', style: linkStyle}, 'QR Generate'),
    React.createElement(Link, {to: '/qr-scan', style: linkStyle}, 'QR Scan'),
    React.createElement(Link, {to: '/dashboard', style: linkStyle}, 'Dashboard'),
    React.createElement(Link, {to: '/map', style: linkStyle}, 'Map')
  );
}

export default Navbar;
